  }, []);

  return (
    <df-messenger
      chat-icon="https://patchwiki.biligame.com/images/bsywy/0/04/gv3sp5mp2gh2caxsk9nkoh6vax0hgo3.png"
      intent="WELCOME"
      chat-title="心情樹洞"
      agent-id="c054175b-675f-49ae-93e2-5671f742914a"
      language-code="zh-tw"
